import "./App.css";
import Home from "./Home";
import { Provider } from "react-redux";
import store from "./redux/store";
import {BrowserRouter ,Routes,Route} from "react-router-dom";
function App() {
  return (
    <Provider store = {store}>
      <BrowserRouter>
      <Routes>
        <Route path></Route>
      </Routes>
      </BrowserRouter>
      <div className="App">
        <Home />
      </div>
    </Provider>
  );
}

export default App;
